import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

function NewUser() {
  const history = useNavigate();
  const [inputs, setInputs] = useState({
    name: "",
    rID: "",
    uID: "",
    email: "",
    dID: "",
    password: "",
  });

  const handleChange = (e) => {
    setInputs((prevState) => ({
      ...prevState,
      [e.target.name]: e.target.value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(inputs);
    sendRequest().then(() => history("/allUsers"));
  };

  const sendRequest = async () => {
    await axios
      .post("http://localhost:5000/user", {
        name: String(inputs.name),
        rID: Number(inputs.rID),
        uID: Number(inputs.uID),
        email: String(inputs.email),
        dID: Number(inputs.dID),
        password: String(inputs.password),
      })
      .then((res) => res.data);
  };

  return (
    <div>
      <div className="absolute top-40 right-8 w-3/4 h-auto bg-white p-2 drop-shadow-xl rounded-xl">
        <form onSubmit={handleSubmit}>
          <div class="mb-4 w-2/5">
            <label
              class="block text-gray-700 text-sm font-bold mb-2"
              for="name"
            >
              Name
            </label>
            <input
              class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              id="name"
              type="text"
              name="name"
              value={inputs.name}
              onChange={handleChange}
              placeholder="Enter User Name"
            />
          </div>

          <div class="mb-4 w-2/5">
            <label
              class="block text-gray-700 text-sm font-bold mb-2"
              for="email"
            >
              Email
            </label>
            <input
              class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              id="email"
              type="email"
              name="email"
              onChange={handleChange}
              value={inputs.email}
              placeholder="Enter User Email"
            />
          </div>

          <div class="mb-4 w-2/5 absolute top-2 right-2">
            <label class="block text-gray-700 text-sm font-bold mb-2" for="uid">
              User ID
            </label>
            <input
              class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              id="uID"
              type="Number"
              name="uID"
              onChange={handleChange}
              value={inputs.uID}
              placeholder="Enter User ID"
            />
          </div>

          <div class="mb-4 w-2/5 absolute top-20 translate-y-3 right-2">
            <label class="block text-gray-700 text-sm font-bold mb-2" for="did">
              Department ID
            </label>
            <input
              class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              id="dID"
              type="Number"
              name="dID"
              onChange={handleChange}
              value={inputs.dID}
              placeholder="Enter Department ID"
            />
          </div>

          <div class="mb-4 w-2/5">
            <label
              class="block text-gray-700 text-sm font-bold mb-2"
              for="password"
            >
              Password
            </label>
            <input
              class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              id="password"
              type="password"
              name="password"
              onChange={handleChange}
              value={inputs.password || ""}
              placeholder="Enter User Password"
            />
          </div>

          <div class="mb-6">
            <label
              class="block text-gray-700 text-sm font-bold mb-2"
              for="message"
            >
              Message
            </label>
            <textarea
              class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              id="message"
              placeholder="Your Message"
            ></textarea>
          </div>

